import React from 'react';

const OffersAndLink = ({ data }) => {
  return (
    <div>
      {data && data.offers && data.offers.length > 0 ? (
        <div>
          <p></p>
          <p></p>
          <a href='' target="_blank" rel="noopener noreferrer">{data.offers[0].link}</a>
        </div>
      ) : (
        <p>No data available</p>
      )}
    </div>
  );
};

export default OffersAndLink;
